        /**
         * STS 파일을 생성해서 주기적으로 내용을 append한다. 
         * 하루에 1개 파일이 생성되면 매 1시간마다 데이터가 축적된다. 
         */
        public void StsCreateProcess()
        {
            dateKey = "";
            while(!isShutdown)
            {
                if (isShutdown == false)
                {
                    stsHandle.Reset();

                    // Directory 체크
                    string yy = DateTime.Now.ToString("yyyy");
                    string mm = DateTime.Now.ToString("MM");
                    string dd = DateTime.Now.ToString("dd");
                    string hh = DateTime.Now.ToString("HH");
                    string mi = DateTime.Now.ToString("mm");
                    string ss = DateTime.Now.ToString("ss");

                    if ( ( mi == "00" || mi == "10" || mi == "20" || mi == "30" || mi == "40" || mi == "50") && ss == "00" )
                    {
                        dateKey = yy + "-" + mm + "-" + dd + " " + hh + ":" + mi + ":" + ss;
                    }
                    else
                    {
                        stsHandle.WaitOne(1000);
                        continue;
                    }
                    log("sta 파일 Generation 수행");
                    string currentFile = "";

                    string currentDir = directoryCheck(yy, mm, dd);

                    // 금일 날짜의 파일이 존재여부 체크
                    string dayCheck = DateTime.Now.ToString("dd");

                    string fileSearch = dayCheck+"_*.sta";
                    string[] stsFiles = Directory.GetFiles(currentDir, fileSearch)   // "*.sta")
                                     .Select(Path.GetFileName)
                                     .ToArray();
                    if (stsFiles.Length == 0)
                    {
                        currentFile = dd + "_" + hh + "_" + mi + "_" + ss + ".sta";
                    }
                    else
                    {
                        currentFile = stsFiles[0];
                    }
                    String checkFile = currentDir + "\\" + currentFile;
                    log("sta file write start : " + checkFile);

                    if (!File.Exists(checkFile))
                    {
                        // Create a file to write to.
                        using (StreamWriter sw = File.CreateText(checkFile))
                        {
                            // head make
                            sw.WriteLine(getStaHeader());
                        }
                    }

                    // This text is always added, making the file longer over time
                    // if it is not deleted.
                    using (StreamWriter sw = File.AppendText(checkFile))
                    {
                        string body = getBodyData();
                        body = dateKey + " " + body;
                        sw.WriteLine(body);
                    }
                    log("sta file  write end: " + checkFile);
                    stsHandle.WaitOne(1000);  //  * 60 * 10); // 10 minute
                }
            }
        }

        private string directoryCheck(string y, string m, string d)
        {
            string path = sourcePath + "\\" + y;
            DirectoryInfo dir1 = new DirectoryInfo(path);
            if (dir1.Exists == false) dir1.Create();

            path = path + "\\" + m;
            DirectoryInfo dir2 = new DirectoryInfo(path);
            if (dir2.Exists == false) dir2.Create();

            path = path + "\\EOLID";
            DirectoryInfo dir3 = new DirectoryInfo(path);
            if (dir3.Exists == false) dir3.Create();

            path = path + "\\DATA";
            DirectoryInfo dir4 = new DirectoryInfo(path);
            if (dir4.Exists == false) dir4.Create();

            return path;

        }


        public void FileCreateProcess()
        {
            int index = 0;
            int print = 1;
            while (!isShutdown)
            {
                if (isShutdown == false)
                {
                    waitHandle.Reset();
                    sector_unit = sector_unit + 1;
                    string yy = DateTime.Now.ToString("yyyy");
                    string mm = DateTime.Now.ToString("MM");
                    string dd = DateTime.Now.ToString("dd");
                    string hh = DateTime.Now.ToString("HH");
                    string mi = DateTime.Now.ToString("mm");
                    string ss = DateTime.Now.ToString("ss");

                    string currentDir = directoryCheck(yy, mm, dd);

                    // 10분에 파일 하나 생성, 5 초에 한번씩 데이터 출력
                    string mi_name = "";
                    int minu = System.Convert.ToInt16(mi);
                    if (minu < 10)
                    {
                        mi_name = "00";
                    }
                    else
                    {
                        minu = minu - (minu % 10);
                        mi_name = System.Convert.ToString(minu);
                    }

                    string rtdCurrentFile = dd + "_" + hh + "_" + mi_name + "_00_0_DBS.rtd";
                    string rawCurrentFile = dd + "_" + hh + "_" + mi_name + "_00_0_DBS.raw";
                    string iniCurrentFile = dd + "_" + hh + "_" + mi_name + "_00_0_DBS.ini";
                    string almFile = dd + "_" + hh + "_" + mi+"_"+ss + ".alm";

                    String checkFile = currentDir + "\\" + rtdCurrentFile;
                    String checkRawFile = currentDir + "\\" + rawCurrentFile;
                    String checkIniFile = currentDir + "\\" + iniCurrentFile;

                    
                    string dateKey = yy + "-" + mm + "-" + dd + " " + hh + ":" + mi + ":" + ss;

                    // 파일에 출력할 타임이라면..
                    if (print % 5 == 0)
                    {
                        log("rtd file write start : " + checkFile);

                        // rtd file
                        if (!File.Exists(checkFile))
                        {
                            // Create a file to write to.
                            using (StreamWriter sw = File.CreateText(checkFile))
                            {
                                // head make
                                sw.WriteLine(getRtdHeader());
                            }
                        }
                        // This text is always added, making the file longer over time
                        // if it is not deleted.
                        using (StreamWriter sw = File.AppendText(checkFile))
                        {
                            string body = getRtdBodyData();
                            body = dateKey + " " + body;
                            sw.WriteLine(body);
                        }
                        // raw file
                        if (!File.Exists(checkRawFile))
                        {
                            // Create a file to write to.
                            using (StreamWriter sw = File.CreateText(checkRawFile))
                            {
                                // head make
                                sw.WriteLine(getRawHeader());
                            }
                        }
                        // This text is always added, making the file longer over time
                        // if it is not deleted.
                        using (StreamWriter sw = File.AppendText(checkRawFile))
                        {
                            string body = getRawBodyData();
                            body = dateKey + " " + body;
                            sw.WriteLine(body);
                        }
                        // init file : 한번만 생성한다.
                        if (!File.Exists(checkIniFile))
                        {
                            // Create a file to write to.
                            using (StreamWriter sw = File.CreateText(checkIniFile))
                            {
                                // data add
                                sw.WriteLine("[PARAMS]");
                                sw.WriteLine("TYPE=3");
                                sw.WriteLine("PARAM1=3");
                                sw.WriteLine("PARAM2=23.5799999237061");
                                sw.WriteLine("PARAM3=1");
                                sw.WriteLine("PARAM4=1000");
                                sw.WriteLine("AVERTIME=1000");
                            }
                        }

                        print = 1;  // init
                    }
                    else
                    {
                        print++;
                    }

                    index++;

                    if (index % 20 == 0)
                    {
                        // almFile
                        AlarmFileProcess(almFile,"1");
                    }

                    log("File creation end...........");
                    //waitHandle.WaitOne(1000 * Convert.ToInt16(m_abertime) + 13);  // unit : second + 13 second
                    waitHandle.WaitOne(1000);   // Convert.ToInt16(m_abertime));  
                }
            }
        }
